import React, { Component } from 'react';
import './gradeEntry.css';
import GradeEntryNavBar from './GradeEntryNavBar';
import GradeEntryTable from './GradeEntryTable';
import ReactDataSheet from 'react-datasheet';
import 'react-datasheet/lib/react-datasheet.css';
import Table from './Table'

class GradeEntryModal extends Component {
    render() {
        return (
            <div className="modal fade" id="gradeEntry" tabIndex={-1} role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog modal-lg mw-100 w-90" role="document">
                  <div className="modal-content">
                    <div className="modal-header">
                      <h5 className="modal-title" id="exampleModalLabel">{this.props.className}</h5>
                      <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">Ã—</span>
                      </button>
                    </div>
                    <div className="modal-body">
                      <GradeEntryNavBar />
                      <Table />
                    </div>
                    <div className="modal-footer">
                      <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                      <button type="button" className="btn btn-primary">Save changes</button>
                    </div>
                  </div>
                </div>
              </div>
        );
    }
}

export default GradeEntryModal;
